import React from 'react'
import * as rb from 'react-bootstrap'
import {useState} from 'react'
import ApexCharts from 'apexcharts'

function Graph(props){


    this.state = {
          
        series: [
          {
            name: 'Bob',
            data: [
              {
                x: 'Block 396 HDB Tampines',
                y: [
                  new Date('2019-03-05').getTime(),
                  new Date('2019-03-08').getTime()
                ]
              },
              {
                x: 'Eastpoint Mall',
                y: [
                  new Date('2019-03-02').getTime(),
                  new Date('2019-03-05').getTime()
                ]
              },
              {
                x: 'Bata',
                y: [
                  new Date('2019-03-05').getTime(),
                  new Date('2019-03-07').getTime()
                ]
              },
              {
                x: 'Barracuda Tech',
                y: [
                  new Date('2019-03-03').getTime(),
                  new Date('2019-03-09').getTime()
                ]
              },
              {
                x: 'Aromas of India',
                y: [
                  new Date('2019-03-08').getTime(),
                  new Date('2019-03-11').getTime()
                ]
              },
              {
                x: '517 Food court',
                y: [
                  new Date('2019-03-11').getTime(),
                  new Date('2019-03-16').getTime()
                ]
              },
            ]
          },
          {
            name: 'Joe',
            data: [
              {
                x: 'Aljunied Industrial Estate',
                y: [
                  new Date('2019-03-02').getTime(),
                  new Date('2019-03-05').getTime()
                ]
              },
              {
                x: 'Bata',
                y: [
                  new Date('2019-03-06').getTime(),
                  new Date('2019-03-16').getTime()
                ]
              },
              {
                x: 'YinJi Singapore',
                y: [
                  new Date('2019-03-03').getTime(),
                  new Date('2019-03-07').getTime()
                ]
              },
              {
                x: 'Aromas of India',
                y: [
                  new Date('2019-03-20').getTime(),
                  new Date('2019-03-22').getTime()
                ]
              },
              {
                x: 'Djitsun Mall',
                y: [
                  new Date('2019-03-10').getTime(),
                  new Date('2019-03-16').getTime()
                ]
              }
            ]
          },
        ],
        options: {
          chart: {height: 450, type: 'rangeBar'},
          plotOptions: {
            bar: {horizontal: true, barHeight: '80%'}
          },
          xaxis: {
            type: 'datetime'
          },
          stroke: {
            width: 1
          },
          fill: {
            type: 'solid',
            opacity: 0.6
          },
          legend: {
            position: 'top',
            horizontalAlign: 'left'
          }
        },
      
      
      };

    return(
        <div style={{display:props.display}}>
            
            <div style={{border:"1px solid #000000", borderRadius:"25px",display:"inline-block", backgroundColor:"#FFFFFF"}}>
                
            </div>

        </div>
    )
    
}

export default Graph
